import React from 'react';
import styled from 'styled-components';
import Button from '../../Button/Button';

const StyledLogout = styled.div`
    padding: 2em 0;
`;

const Logout = (props) => {
    return (
        <StyledLogout>
            <p>Are you sure you want to log out?</p>
            <div>
                <Button type="button"/>
            </div>
        </StyledLogout>
    );
}

export default Logout;
